import axios from 'axios';

const api = axios.create({
    baseURL: 'http://localhost:8000/api'
});

const login = async (email, password) => {
    try {
        const response = await api.post('/login', { email, password });
        return response.data; 
    } catch (error) {
        throw error; 
    }
};

export { login };
